import React,{ Component } from 'react';
import { Link } from 'react-router-dom';
import { Table, Select, Input, Divider, Tag } from 'antd';

const { Column } = Table;
const { Option } = Select;
const Search = Input.Search;

class OrderList extends Component{
	constructor(props){
        super(props);
        this.state = {
            data: []
        };
	}
	render(){
		return(
			<div>
        <div>
          <Select defaultValue="1" style={{ width: 200, marginRight: 10 }} onChange={this.handleChange.bind(this)}>
              <Option value="1">按商品id搜索</Option>
            </Select>
            <Search
            placeholder="关键词"
            enterButton="搜索"
            style={{ width: 280 }}
            onSearch={value => this.onSearchDate(value)}
            />
        </div>
        <Table dataSource={data}>
          <Column title="订单号" dataIndex="firstName" key="firstName" />
          <Column title="收件人" dataIndex="lastName" key="lastName" />
          <Column title="订单状态" dataIndex="age" key="age" />
          <Column title="订单总价" dataIndex="address" key="address" />
          <Column title="订单时间" dataIndex="address" key="address" />
          <Column
            title="操作"
            key="action"
            render={(text, record) => (
              <span>
              <Link to={`/admin/order/detail/${record.key}`}>详情</Link>
              </span>
            )}
          />
        </Table>
      </div>
		)
	}
}

const data = [
  {
    key: '1',
    firstName: 'John',
    lastName: 'Brown',
    age: 32,
    address: 'New York No. 1 Lake Park',
    tags: ['nice', 'developer'],
  },
  {
    key: '2',
    firstName: 'Jim',
    lastName: 'Green',
    age: 42,
    address: 'London No. 1 Lake Park',
    tags: ['loser'],
  },
  {
    key: '3',
    firstName: 'Joe',
    lastName: 'Black',
    age: 32,
    address: 'Sidney No. 1 Lake Park',
    tags: ['cool', 'teacher'],
  },
];


export default OrderList;
